// Tooltips
$_MODULE['<{videodesk}prestashop>home-login_a8a051fa0c4788320dcf273106bea09b'] = 'A propos de l\'ID Site Videodesk';
$_MODULE['<{videodesk}prestashop>home-login_92faf6fecac3ab43f364cf47a530cfce'] = 'Si vous êtes déjà un membre enregistré de Videodesk, vous pouvez lier votre compte déjà existant avec votre site PrestaShop : copiez-collez votre ID videodesk ici, puis cliquez sur le bouton "Se connecter".  L\' ID Site Videodesk est un texte au format "32 chiffres – 10 chiffres" affiché dans votre back office Videodesk (dans le menu "Site(s)")';
$_MODULE['<{videodesk}prestashop>home_a8a051fa0c4788320dcf273106bea09b'] = 'A propos de l\'ID Site Videodesk';
$_MODULE['<{videodesk}prestashop>home_92faf6fecac3ab43f364cf47a530cfce'] = 'Si vous êtes déjà un membre enregistré de Videodesk, vous pouvez lier votre compte déjà existant avec votre site PrestaShop : copiez-collez votre ID Site Videodesk ici, puis cliquez sur le bouton "Se connecter".  L\' ID Site Videodesk est un texte au format "32 chiffres – 10 chiffres" affiché dans votre back office Videodesk (dans le menu "Site(s)")';
$_MODULE['<{videodesk}prestashop>signup-step-2_6bdb86165fd72891ee2c404c5a864759'] = 'Choisissez des conseillers';
$_MODULE['<{videodesk}prestashop>signup-step-2_784f0e6625fad31f23ed174aee8b4d59'] = 'Chaque agent a besoin d\'un compte pour être affiché sur Videodesk et discuter avec vos clients. Videodesk peut importer certains de vos employés PrestaShop et créer les comptes Videodesk facilement. Sélectionnez ci-dessous les employés qui utiliseront Videodesk (si vous avez plusieurs sites Web, vous pouvez choisir sur quel site(s) chaque agent va interagir), puis cliquez sur le bouton "Importer". Sur la page suivante, toutes les informations (noms, adresses mail, les langues, etc.) des employés sélectionnés seront automatiquement préremplies dans le formulaire de création de comptes. Vous aurez seulement besoin de vérifier les données et de les valider (vous serez en mesure de changer et/ou de valider les données avant de les envoyer à Videodesk).';
$_MODULE['<{videodesk}prestashop>shop-configuration_03d983ebaa3bfc62c0c94434acae4173'] = 'Affichage de Videodesk';
$_MODULE['<{videodesk}prestashop>shop-configuration_bd6a1a8eb02b291633fca0607bd6daad'] = 'Cochez l\'option "Afficher", si vous souhaitez afficher Videodesk sur votre site web. Vous pouvez restreindre l\'affichage de Videodesk à une adresse IP et être le seul à voir Videodesk (par exemple pour des tests). Si vous ne connaissez pas votre adresse IP, veuillez utiliser des outils gratuits en ligne comme www.tracemyip.org ou www.whatismyip.com. Cochez l\'option "Masquer" si vous voulez cacher en permanence Videodesk sur votre site.';
$_MODULE['<{videodesk}prestashop>shop-configuration_01e6576a9d2c3b72e757b056516ccb57'] = 'Configuration des critères d\'affichage';
$_MODULE['<{videodesk}prestashop>shop-configuration_6396bbda72c28e385bab761e0d33a677'] = 'Vous pouvez choisir de toujours afficher Videodesk (sélectionnez l\'option "Toujours afficher") ou seulement lorsque les critères sont satisfaits (sélectionnez l\'option "Si une / l\'ensemble des règle suivante est satisfaite"). Pour configurer les critères, choisissez si toutes les règles doivent être satisfaites (sélectionnez l\'option "l\'ensemble") ou si une seule règle est suffisante pour afficher Videodesk (sélectionnez l\'option « une»), puis sélectionnez 1 à 5 règles.';
$_MODULE['<{videodesk}prestashop>shop-configuration_abd8762ed74699e257a7c1f82e117c43'] = 'Périmètre d\'affichage Videodesk';
$_MODULE['<{videodesk}prestashop>shop-configuration_1d69f19ad9e9f2a448233ba5d31461ae'] = 'Vous pouvez choisir d\'afficher Videodesk sur toutes les pages de votre site (sélectionnez l\'option "Toutes les pages") ou choisir d\'afficher Videodesk sur une sélection de pages (sélectionnez l\'option "Pages suivantes" et cochez ci-dessous les pages où Videodesk doit être affiché).';
$_MODULE['<{videodesk}prestashop>shop-configuration_6887a4708b211174e4f24e4586ad6b48'] = 'Statistiques';
$_MODULE['<{videodesk}prestashop>shop-configuration_dc82396da06505c832738ab79f4f496a'] = 'Les statistiques vous permettent...';

